%[text]{"align":"center"} # **ACM/IDS 104 \- Problem Set 5 \- MATLAB Problems**
%[text] *Before writing your MATLAB code, it is always good practice to get rid of any leftover variables and figures from previous scripts.*
clc; clear; close all;
%[text] ## Problem 1 (10 points) Application of  Projections to Approximation
%[text] In Problem 4 of PS4, we saw that even higher degree interpolating polynomials may not be accurate approximations to complex functions. We have the function:
%[text]{"align":"center"} $f(x) = \\frac{\\cos x}{\\cosh x}, \\,\\,\\,\\,\\,\\mbox{on } [\-a,a],\\,\\,\\,\\,\\, a=5$
%[text] Let us recall how this function looks like and how its interpolating polynomials of degree $(n\-1)$ for $n = 3,5,10,15$ behave:
%{
Setup
%}
f = @(x) cos(x)./cosh(x); % our function
a = 5; % setting the value of a
n = [3 5 10 15]; % setting the number of points
sub = 1; % subplot index

%{
How f(x) looks like on [-5, 5]
%}
figure; %[output:701f97cc]
fplot(f, [-a, a], "-c", "lineWidth", 4); %[output:701f97cc]
title("$\frac{\cos{x}}{\cosh{x}}$ on $[-5, 5]$","Interpreter","latex"); %[output:701f97cc]

%{
Read the discussion below and complete the code
%}
figure; %[output:28131bbe]
for ival = a %[output:group:2f1c4de2]
    for degree = n-1
        %{
        INTERPOLATING POLYNOMIALS -- no changes needed
        -> Select degree+1 points in the interval
        -> Evaluate f(x) on these points
        -> Find the polynomial coefficients
        %}
        pts = ones(degree+1, 2); % initializing the points
        pts(:, 1) = linspace(-ival, ival, degree+1); % setting the x-values
        for i = 1 : degree+1
            pts(i, 2) = f(pts(i, 1)); % evaluating cos(x) / cosh(x)            
        end
        coeffs = polyfit(pts(:, 1), pts(:, 2), degree); % coefficients
        %{
        ORTHOGONAL PROJECTIONS -- TODO
        -> Get transformed Legendre polynomials
        -> Find alpha_k using L^2 inner product
        -> Evaluate alpha_k*Q_k
        %}
        x = linspace(-a, a);
        y = zeros(100 ,1);
        alpha_k = zeros(degree, 1);

        for d=0:degree
            numrgrand = @(x) (f(x) .* legendreP(d, x/a));
            denrgrand = @(x) (legendreP(d, x /a) .* legendreP(d,x/a));
            alpha_k(d+1) = integral(numrgrand, -a,a)/integral(denrgrand,-a, a);
        end
        alpha_k %[output:274caded] %[output:051a5141] %[output:10ad0f5f] %[output:33e20290]

        for i = 1:100
         valati = 0;

         for d = 0:degree
            valati = valati + legendreP(d, x(i)/a) * alpha_k(d + 1);
         end

         y(i) = valati;
        end

        %{ 
        PLOTTING
        Plot f(x), the sampled points, interpolating and approximating
        polynomials
        Please use different colors and linestyles
        %}
        subplot(2, 2, sub); %[output:28131bbe]
        fplot(f, [-ival, ival], "-c", "lineWidth", 4);
        hold on
        interpoints = linspace(-ival, ival);
        p = polyval(coeffs, interpoints); % evaluating coeffs in interval
        plot(interpoints, p, "-.m", "lineWidth", 2);
        plot(pts(:, 1), pts(:, 2), "ok", "MarkerSize", 2, "lineWidth", 3);
        plot(x, y, "-r", "MarkerSize", 3, "lineWidth", 3);
        title(strcat("n = ", int2str(degree+1)));
        sub = sub + 1; % increase subplot index
    end
end %[output:group:2f1c4de2]
%[text] Now, instead of interpolating polynomials, let us approximate $f(x)$ by its orthogonal projection onto the inner space $\\mathcal{P}^{(n\-1)}\_{[\-a,a]}$ of polynomials on $[\-a,a]$, equipped with the $L^2$ inner product:
%[text]{"align":"center"} $f(x)\\approx p(x)=\\mathrm{pr}\_{\\mathcal{P}^{(n\-1)}\_{[\-a,a]}}f(x)$
%[text] Recall (Lecture 10) that $p(x)$ is the closest (in the $L^2$ sense) polynomial to $f(x)$ in $\\mathcal{P}^{(n\-1)}\_{[\-a,a]}$, i.e.
%[text]{"align":"center"} $p(x)=\\arg\\min\_{q\\in\\mathcal{P}^{(n\-1)}\_{[\-a,a]}}\\|f(x)\-q(x)\\|$
%[text] We know that the transformed Legendre polynomials $\\widetilde{Q}\_0(x),\\cdots,\\widetilde{Q}\_{n\-1}(x)$ form an orthogonal basis of $\\mathcal{P}^{(n\-1)}\_{[\-a,a]}$, and, therefore:
%[text]{"align":"center"} $p(x)=\\sum\_{k=0}^{n\-1}\\alpha\_k\\widetilde{Q}\_k(x)$
%[text] where $\\alpha\_k$ are the coordinates of $p(x)$ in that basis.
%[text] Modify the above code to find the approximating polynomials as well. Plot each approximating polynomial on its corresponding subplot. Useful functions for this problem:
%[text]{"align":"center"} $\\texttt{legendreP(), integral()}$

